description:
Agatha is a Senior Software Engineer at Amazon.

Agatha graduated with honors from the University of Pennsylvania-School of Engineering and Applied Science with a Bachelors Degree in Electrical Engineering and a minor in Computer Science. She also has a Masters Degree in Computer Science from New York University. Agatha is always seeking new opportunities to learn. She loves being challenged and being able to translate business requirements into technical solutions.

Specialties: Windows, Linux; 
Java, Javascript; 
HTML, CSS, Angular;
Microsoft Word, Excel, PowerPoint, Outlook;
Fluent in Portuguese, Advanced Spanish.

Certifications: AWS Solutions Architect (Associate Level)

Fun Projects
Sometimes I do projects whether it is for my NYU Masters Degree or just for fun. These are listed below:
- Dominoes App: Download this dominoes game from either the Google Play Store or the Apple Store. It was developed by me as part of my Social and Multiplayer Games class at NYU
http://gameinvite.us/?agathaoliveira/dominoes

